// eslint-disable-next-line
import React, { useState } from "react";
import "./App.css";
import Login from "./Login";
import proto from "./pb/proto_grpc_web_pb"
import { Routes, Route } from "react-router-dom";

var subastaService = new proto.SubastaServiceClient('http://0.0.0.0:8000');

function App(){
  const [info, setInfo] = useState(0)

  function takeSubastas(){
    var request = new proto.Empty();
    var metadata = {};
    subastaService.getSubastas(request, metadata, function(err, response) {
      if (err) {
        console.log(err.code, err.message);
      } else {
        console.log(response.getSubastasList());
      }
    });
  }

  return(
    <div className="App">
      <Card sx={{ minWidth: 275 }}>
      <CardContent>
        <Typography sx={{ fontSize: 14 }} color="text.secondary" gutterBottom>
          Word of the Day
        </Typography>
        <Typography variant="h5" component="div">
          be{bull}nev{bull}o{bull}lent
        </Typography>
        <Typography sx={{ mb: 1.5 }} color="text.secondary">
          adjective
        </Typography>
        <Typography variant="body2">
          well meaning and kindly.
          <br />
          {'"a benevolent smile"'}
        </Typography>
      </CardContent>
      <CardActions>
        <Button size="small">Learn More</Button>
      </CardActions>
    </Card>
      <button href="#" onClick={takeSubastas}>Clickeame</button>

      <Routes>
        <Route path="/login" element={<Login />} />
        <Route path="*" />
      </Routes>
    </div>
  );
}

export default App;
